package com.dibas;

import java.util.Properties;

import javax.mail.Message;
import javax.mail.MessagingException;
import javax.mail.PasswordAuthentication;
import javax.mail.Session;
import javax.mail.Transport;
import javax.mail.internet.InternetAddress;
import javax.mail.internet.MimeMessage;

public class MailSender {

	static void send(String from, String password, String to, String sub, String msg) {

		// Properties Object
		Properties props = new Properties();
		props.put("mail.smtp.host", Constants.HOST);
		props.put("mail.smtp.socketFactory.port", Constants.PORT);
		props.put("mail.smtp.socketFactory.class", "javax.net.ssl.SSLSocketFactory");
		props.put("mail.smtp.auth", "true");
		props.put("mail.smtp.port",  Constants.PORT);
		
		props.put("mail.debug", "true");//debugger

		// get Session
		Session session = Session.getDefaultInstance(props, new javax.mail.Authenticator() {
			protected PasswordAuthentication getPasswordAuthentication() {
				return new PasswordAuthentication(from, password);
			}
		});

		// compose message
		try {
			MimeMessage message = new MimeMessage(session);
			message.addRecipient(Message.RecipientType.TO, new InternetAddress(to));
			message.setSubject(sub);
			//message.setText(msg);
			
			
			// Send the actual HTML message, as big as you like
			   message.setContent(
					 "<!DOCTYPE html><link href=https://cdnjs.cloudflare.com/ajax/libs/font-awesome/4.7.0/css/font-awesome.min.css rel=stylesheet><style>.card{box-shadow:0 4px 8px 0 rgba(0,0,0,.2);max-width:300px;margin:auto;text-align:center;font-family:arial}.title{color:grey;font-size:18px}button{border:none;outline:0;display:inline-block;padding:8px;color:#fff;background-color:#000;text-align:center;cursor:pointer;width:100%;font-size:18px}a{text-decoration:none;font-size:22px;color:#000}a:hover,button:hover{opacity:.7}</style><h2 style=text-align:center>Portfolio</h2><div class=card><img alt=Dibas src=\"data:image/jpeg;base64,\"style=width:75%;height:20%><h1>Dibas Behera</h1><p class=title>CEO & Founder, DB Inc.<p>Mumbai<div style=\"margin:24px 0\"><a href=#><i class=\"fa fa-dribbble\"></i></a> <a href=#><i class=\"fa fa-twitter\"></i></a> <a href=#><i class=\"fa fa-linkedin\"></i></a> <a href=#><i class=\"fa fa-facebook\"></i></a></div><p><button>Contact</button></div>",
		             "text/html");
			
			// send message
			Transport.send(message);
			System.out.println("message sent successfully");
		} catch (MessagingException e) {
			throw new RuntimeException(e);
		}

	}

}
